import React from 'react';

const MainPage = () => {
    return (
        <div className='mainPage'>
            <h1>Witamy na aplikacji książkowej!</h1>
            <h2>Aplikacja stworzona przez:</h2>
            <h2>W tej aplikacji możesz przeglądać i wyszukiwać książki, 
                a po zarejestrowaniu i zalogowaniu możesz również dodawać je do sekcji do przeczytania i przeczytanych.
                Kiedy już dodasz książki do sekcji przeczytane, możesz również dodać je do ulubionych.</h2>
        </div>
    );
};

export default MainPage;
